p\nstartup. This includes the empty initial model, a model opened via command\nline arguments, or auto-restored models on Mac OS X.", :name=>:expectsStartupModelNotifications, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#expectsStartupModelNotifications", :type=>:method, :visibility=>:public, :return=>["Boolean", "Return +true+ to receive {#onNewModel} and\n{#onOpenModel} calls for startup models. Return +false+ or simply not\nimplement the method in order to not receive these calls (which was the\nbehaviour prior to SketchUp 2014)."]}, "Sketchup::AppObserver#onActivateModel"=>{:description=>"Called when an open model is activated. This is relevant on Mac only which\nsupports multiple documents to be opened simultaneously.", :name=>:onActivateModel, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#onActivateModel", :type=>:method, :visibility=>:public, :parameters=>[["model", ["Sketchup::Model"], "The newly-activated model object."]], :return=>["void", ""]}, "Sketchup::AppObserver#onNewModel"=>{:description=>"Called when the application creates a new, empty model.", :name=>:onNewModel, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#onNewModel", :type=>:method, :visibility=>:public, :parameters=>[["model", ["Sketchup::Model"], "The active model object."]], :return=>["void", ""]}, "Sketchup::AppObserver#onOpenModel"=>{:description=>"Called when the application opens an existing model.", :name=>:onOpenModel, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#onOpenModel", :type=>:method, :visibility=>:public, :parameters=>[["model", ["Sketchup::Model"], "The active model object."]], :return=>["void", ""]}, "Sketchup::AppObserver#onQuit"=>{:description=>"Triggered when SketchUp closes. This is useful if you need to clean up\nanything or store your application state upon close.", :name=>:onQuit, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#onQuit", :type=>:method, :visibility=>:public, :return=>["void", ""]}, "Sketchup::AppObserver#onUnloadExtension"=>{:description=>"Called when the user turns off a Ruby extension. This is useful for\ndetecting if the user is deactivating some critical set of observers, for\nexample, so you can warn them or cache your plugin state.", :name=>:onUnloadExtension, :namespace=>"Sketchup::AppObserver", :path=>"Sketchup::AppObserver#onUnloadExtension", :type=>:method, :visibility=>:public, :parameters=>[["ext_name", ["String"], "The name of the extension just unloaded."]], :return=>["void", ""]}, "Sketchup::ArcCurve"=>{:description=>"An {ArcCurve} is a {Curve} that makes up part of a circle. This is the\nunderlying class for circles as well.\n\nYou can think of ArcCurves as entities that were created with SketchUp's Arc\nor Circle drawing tools and Curves as entities that were created with the\nFreehand drawing tool.\n\nHowever, keep in mind that all Curves in SketchUp are really edges with some\nextra data attached to them. When you use the API to draw a {Curve} or\n{ArcCurve}, you are really drawing edges.\n\n{ArcCurve} is a subclass of {Curve}, so all of the methods that are\navailable to Curves are also available to ArcCurves.", :name=>:ArcCurve, :namespace=>"Sketchup", :path=>"Sketchup::ArcCurve", :type=>:class, :visibility=>:public}, "Sketchup::ArcCurve#center"=>{:description=>"Get center of the circular arc.", :name=>:center, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#center", :type=>:method, :visibility=>:public, :return=>["Geom::Point3d", "Center of the arc if successful."]}, "Sketchup::ArcCurve#end_angle"=>{:description=>"Get the angle of the end of the arc measured from the X axis in radians.", :name=>:end_angle, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#end_angle", :type=>:method, :visibility=>:public, :return=>["Numeric", "The angle of the end of the arc (in radians) if\nsuccessful."]}, "Sketchup::ArcCurve#normal"=>{:description=>"Get arc normal, the vector that is perpendicular to the plane of the arc.", :name=>:normal, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#normal", :type=>:method, :visibility=>:public, :return=>["Geom::Vector3d", "The normal of the arc if successful."]}, "Sketchup::ArcCurve#plane"=>{:description=>"Get arc plane.", :name=>:plane, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#plane", :type=>:method, :visibility=>:public, :return=>["Array<Numeric>", "An a array of four values representing the plane\nof the arc curve."]}, "Sketchup::ArcCurve#radius"=>{:description=>"Get arc radius.", :name=>:radius, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#radius", :type=>:method, :visibility=>:public, :return=>["Numeric", "The radius of the arc if successful."]}, "Sketchup::ArcCurve#start_angle"=>{:description=>"Get the angle of the start of the arc, measured from the X axis in\nradians.", :name=>:start_angle, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#start_angle", :type=>:method, :visibility=>:public, :return=>["Numeric", "The angle of the start of the arc (in radians) if\nsuccessful."]}, "Sketchup::ArcCurve#xaxis"=>{:description=>"Get the X axis of the arc's coordinate system.", :name=>:xaxis, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#xaxis", :type=>:method, :visibility=>:public, :return=>["Geom::Vector3d", "The xaxis of the arc's coordinate system if\nsuccessful."]}, "Sketchup::ArcCurve#yaxis"=>{:description=>"Get the Y axis of the arc's coordinate system.", :name=>:yaxis, :namespace=>"Sketchup::ArcCurve", :path=>"Sketchup::ArcCurve#yaxis", :type=>:method, :visibility=>:public, :return=>["Geom::Vector3d", "The yaxis of the arc's coordinate system if\nsuccessful."]}, "Sketchup::AttributeDictionaries"=>{:description=>"The {AttributeDictionaries} class is a collection of all of the\n{AttributeDictionary} objects that are attached to a given Entity object.\n\nThe {Entity} class is a popular parent class in SketchUp, meaning you can\nattach {AttributeDictionaries} to almost anything, from geometric items like\nedges and faces and components to more conceptual things like pages or\nmaterials.\n\nYou access this class not by performing an <tt>AttributeDictionaries.new</tt>\nbut by grabbing a handle from an existing entity.\n\nBy default, when entity is created it has no {AttributeDictionaries} object:\n  g = Sketchup.active_model.entities.add_group\n  g.attribute_dictionaries # => nil\nThe {AttributeDictionaries} object is added to the entity only once the first\nattribute is added to the entity:\n  g.set_attribute(\"Test\", \"Yo\", \"Hello\")\n  g.attribute_dictionaries # => #<Sketchup::Group:0x00000007569bc0>>\nWhen iterating through entity attribute dictionaries, be sure to verify that\n<tt>Sketchup::Entity.#attribute_dictionaries</tt> is not <tt>nil</tt>.", :name=>:AttributeDictionaries, :namespace=>"Sketchup", :path=>"Sketchup::AttributeDictionaries", :type=>:class, :visibility=>:public}, "Sketchup::AttributeDictionaries#[]"=>{:description=>"Get an {AttributeDictionary} object by name.", :name=>:[], :namespace=>"Sketchup::AttributeDictionaries", :path=>"Sketchup::AttributeDictionaries#[]", :type=>:method, :visibility=>:public, :parameters=>[["key", ["String"], "The name of the attribute dictionary."]], :return=>["AttributeDictionary", "An attribute dictionary if it exits or +nil+\nif none with the specified key exist."]}, "Sketchup::AttributeDictionaries#delete"=>{:description=>"Destroy {AttributeDictionary} object.", :name=>:delete, :namespace=>"Sketchup::AttributeDictionaries", :path=>"Sketchup::AttributeDictionaries#delete", :type=>:method, :visibility=>:public, :parameters=>[["key_or_dict", ["AttributeDictionary", "String"], "The name of the attribute\ndictionary to delete or the object itself."]], :return=>["AttributeDictionaries", "The modified attribute dictionaries."]}, "Sketchup::AttributeDictionaries#each"=>{:description=>"Iterate through all of the attribute dictionaries.", :n