mponents. Additionally, there are bounding boxes for\n{Sketchup::Drawingelement} objects, including components and groups.\nBounding boxes are only large enough to exactly bound the entities within\nyour model, group, or component.\n\nYou can also create arbitrary {BoundingBox} objects by calling\n<tt>BoundingBox.new</tt>.", :name=>:BoundingBox, :namespace=>"Geom", :path=>"Geom::BoundingBox", :type=>:class, :visibility=>:public}, "Geom::BoundingBox#add"=>{:description=>"Add a point, vertex, or other bounding boxes to the bounding box. The size\nof the bounding box will increase as necessary to accommodate the new\nitems.\n\nAdding one point to an empty bounding box does not increase the size of\nthe bounding box. You must add at least two points before methods such as\n<tt>BoundingBox.#diagonal</tt> will return a size greater than zero.", :name=>:add, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#add", :type=>:method, :visibility=>:public, :parameters=>[["things", ["Geom::Point3d", "Sketchup::Vertex", "Geom::BoundingBox"], "A list\nor single instance of {Point3d}, {Sketchup::Vertex}, or {BoundingBox}\nobjects."]], :return=>["Geom::BoundingBox", "The current {BoundingBox} object."]}, "Geom::BoundingBox#center"=>{:description=>"Get the center point of the bounding box.", :name=>:center, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#center", :type=>:method, :visibility=>:public, :return=>["Geom::Point3d", "The center point of the BoundingBox."]}, "Geom::BoundingBox#clear"=>{:description=>"Remove all points from the bounding box. A cleared BoundingBox does not\nhave an points; therefore, the size is zero.", :name=>:clear, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#clear", :type=>:method, :visibility=>:public, :return=>["Geom::BoundingBox", "The current {BoundingBox} object."]}, "Geom::BoundingBox#contains?"=>{:description=>"Determine if the current bounding box  contains a specific {Point3d} or\n{BoundingBox} object.", :name=>:contains?, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#contains?", :type=>:method, :visibility=>:public, :parameters=>[["thing", ["Array<Numeric>", "Geom::Point3d", "Geom::BoundingBox"], nil]], :return=>["Boolean", "+true+ if the bounding box contains the specified thing\nor +false+ if not."]}, "Geom::BoundingBox#corner"=>{:description=>"Get point at specified corner of the bounding box.\n\nThere are 8 corners to a bounding box, identified by the numbers 0..7.\nPoints are returned in the currently set units (inches by default).\n\nThese are which index refers to which corner:\n  0 = [0, 0, 0] (left front bottom)\n  1 = [1, 0, 0] (right front bottom)\n  2 = [0, 1, 0] (left back bottom)\n  3 = [1, 1, 0] (right back bottom)\n  4 = [0, 0, 1] (left front top)\n  5 = [1, 0, 1] (right front top)\n  6 = [0, 1, 1] (left back top)\n  7 = [1, 1, 1] (right back top)", :name=>:corner, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#corner", :type=>:method, :visibility=>:public, :parameters=>[["n", ["Fixnum"], "A number between 0 and 7."]], :return=>["Geom::Point3d", "The position of the corner at _n_."]}, "Geom::BoundingBox#depth"=>{:description=>"Get the depth of the bounding box.\n\nThe depth is returned in the currently set units (inches by default).", :name=>:depth, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#depth", :type=>:method, :visibility=>:public, :return=>["Length", "The depth of the bounding box in currently set units."]}, "Geom::BoundingBox#diagonal"=>{:description=>"Get the length of the diagonal of the bounding box.\n\nThe diagonal is returned in the currently set units (inches by default).", :name=>:diagonal, :namespace=>"Geom::BoundingBox", :path=>"Geom::BoundingBox#diagonal", :type=>:method, :visibility=>:public, :return=>["Length", "The diagonal of the bounding box in currently set units."]}, "Geom::BoundingBox#empty?"=>{:description=>"Determine if the bounding box is empty, such as if the bounds have not\nbeen set. Thi